import React from 'react';

const DisplayMap = ({mapToDisplay, clickable}) => {

    if (clickable){
        return
    }
  return (
    <ul>
      {mapToDisplay.map((item, index) => (
        <li key={index}>
          {Object.entries(item).map(([key, value]) => (
            <div key={key}>
              <strong>{key}:</strong> {value}<br />
            </div>
          ))}
        </li>
      ))}
    </ul>
  );
};

export default DisplayMap;
